import React from 'react';

import '../styles/app.css';
import TextField from "@mui/material/TextField";
import IconButton from '@mui/material/IconButton';
import SearchIcon from '@mui/icons-material/Search';

export default function Header() {
  return (<div className="header">
      <div className="headerLogo flexCenter">GatorStore</div>
      <div className="searchBarContainer flexCenter">
        <TextField variant ="outlined" label="Search" size="small" width="800px"/>
        <IconButton color="primary"><SearchIcon/></IconButton>
      </div>
      <div className="accountButton flexCenter">Seller</div>
  </div>);
}
